import React from 'react';
import './JExSRight.css';
const JExcSecRight = () => {
    return (<>
        <div className="col-md-6 col-12 order-md-2 order-1">
            <iframe width="462" height="270" src="https://www.youtube.com/embed/eY7VHIdoC78" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen className="rounded"
            ></iframe>
        </div>
    </>)
}

export default JExcSecRight;
